  [],\n\t\"revision_timestamp\": \"2016-07-27T22:23:44.392861\",\n\t\"name\": \"horicon-national-wildlife-refuge-annual-narrative-report-calendar-year-1995\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Horicon
  National Wildlife Refuge outlines Refuge accomplishments during the 1995 calendar
  year.  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the management plan and research and investigations. Refuge administration is outlined;
  information about personnel, youth programs, manpower programs, volunteer programs,
  funding, and safety is given. Habitat management is also covered; subjects include
  wetlands, grazing, haying, fire management, pest control, and private lands. The
  wildlife section of the report discusses wildlife diversity, endangered and threatened
  species, waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals,
  marking and banding, and disease control. The public uses of the Refuge described
  in this report include outdoor classrooms, interpretive programs, hunting, fishing,
  trapping, wildlife observation, outdoor recreation, and law enforcement. The equipment
  and facilities section of the report provides information about rehabilitation,
  equipment replacement, communication systems, computer systems, and energy conservation.
  Economic uses of the Refuge and items of interest are provided at the end. Refuge
  brochures and field guides are attached.\",\n\t\"license_title\": \"License Not
